import React from 'react'
const PaginatorBtn = (props)=> {
    return (
      <button
        className="direction-btn mr-3"
        onClick={() => {
          props.setPage(props.num);
        }}
      >
        {props.text}
      </button>
    );
}

export default PaginatorBtn
